import React from 'react';
import styled from 'styled-components';
const Card = () => {
  const Background = styled.div`
    background-color: white;
    height: 350px;
    width: 350px;
    margin-bottom: 20px;
    padding: 10px;
  `;
  const UnderLine = styled.div`
    text-decoration: underline;
    font-size: 0.5rem;
  `;
  return (
    <>
      <Background>
        <UnderLine>단어</UnderLine>
      </Background>
    </>
  );
};

export default Card;
